import { Component } from "../core/component";
import { IFixedUpdatable, IStartable } from "../assetloader/json/Interfaces/object_interfaces";
import { IDataHolder } from "../assetloader/json/interfaces/idata_holder";
import { GameObject } from "../core/game_object";
import PhysicsColliderComponent from "./collision/physics_collider_component";
import { PhysicsWorld } from "../../../box2d/box2d/physics_handler/main/physics_world";
import { BodyTypes } from "../../../box2d/box2d/physics_handler/enum/body_types";
import { PhysicsOptions } from "../../../box2d/box2d/physics_handler/reference/physics_options";
import { Mathf } from "../../../utility/math_extended/mathf";
import ICollision from "../../../box2d/box2d/physics_handler/interfaces/icollision";
import { Vector2 } from "../../../utility/math_extended/vector2";
import { Application } from "../../../../app";


export class RigidBody extends Component implements IFixedUpdatable, IStartable, IDataHolder {

  protected _type: string = 'RigidBody';
  //variables
  private _attachedBody: number = -1;
  private _world: PhysicsWorld;
  private _bodyType: BodyTypes;
  public data: PhysicsOptions;

  //getters and setters
  public get attachedBody(): number {
    return this._attachedBody;
  }

  get relationPointVelocity() {
    throw new Error('Method not implemented.');
  }

  get isSleeping(): boolean {
    throw new Error('Method not implemented.');
  }

  constructor(gameObject: GameObject, bodyType: BodyTypes = 3, componentData: PhysicsOptions = new PhysicsOptions(gameObject+"RigidBodyPhysics")) {
    super(gameObject);
    this._world = Application.instance._physics.world;

    this._bodyType = bodyType;
    this.data = componentData.GetCopy();
  }

  Awake() {
    super.Awake();
    this.data.rotation = Mathf.degreesToRadians(this.gameObject.transform.rotation);
    this._attachedBody = this._world.CreateBody(this._bodyType, this.gameObject.GetComponent('PhysicsColliderComponent') as PhysicsColliderComponent, this.data).ID;
    let collider = this.gameObject.GetComponent('PhysicsColliderComponent');
    if (collider instanceof PhysicsColliderComponent) {
      let shapeComp = collider;
      let body = this._world.GetBodyByID(this.attachedBody);
      let toDispath = (collision: ICollision) => 
      {
        shapeComp.onCollision.dispatch(collision);
      }
      body.OnCollision.sub(toDispath);
    }
  }

  get angularDrag(): number {
    let body = this._world.GetBodyByID(this.attachedBody);
    return body.angularDrag;
  }

  get angularVelocity() {
    let body = this._world.GetBodyByID(this.attachedBody);
    return body.angularVelocity;
  }

  get centerOfMass(): Vector2 {
    let body = this._world.GetBodyByID(this.attachedBody);
    return body.centerOfMass;
  }

  get drag(): number {
    let body = this._world.GetBodyByID(this.attachedBody);
    return body.drag;
  }

  get mass(): number {
    let body = this._world.GetBodyByID(this.attachedBody);
    return body.mass;
  }

  get velocity(): Vector2 {
    let body = this._world.GetBodyByID(this.attachedBody);
    return body.linearVelocity;
  }

  FixedUpdate(): void {
    let attachedBody = this._world.GetBodyByID(this._attachedBody);
    this.gameObject.transform.position = attachedBody.position;
    this.gameObject.transform.rotation = attachedBody.rotation;
  }

  addExplosionForce(explosionForce: number, explosionPosition: Vector2, explosionRadius: number) {
    let body = this._world.GetBodyByID(this.attachedBody);
    body.addExplosionForce(explosionForce, explosionPosition, explosionRadius);
  }

  addForce(force: Vector2) {
    let body = this._world.GetBodyByID(this.attachedBody);
    body.addForce(force);
  }

  addForceAtPosition(force: Vector2, position: Vector2) {
    let body = this._world.GetBodyByID(this.attachedBody);
    body.addForceAtPosition(force, position);
  }

  addRelativeForce(force: Vector2) {
    let body = this._world.GetBodyByID(this.attachedBody);
    body.addRelativeForce(force);
  }

  addRelativeTorque(torque: Vector2) {
    let body = this._world.GetBodyByID(this.attachedBody);
    body.addRelativeTorque(torque);
  }

  addTorque(torque: number) {
    let body = this._world.GetBodyByID(this.attachedBody);
    body.addTorque(torque);
  }

  SetPosition(position: Vector2): void {
    let body = this._world.GetBodyByID(this.attachedBody);
    body.position = position;
  }

  SetRotation(radians: number): void {
    let body = this._world.GetBodyByID(this.attachedBody);
    body.rotation = radians;
  }

  Destroy() {
    this._world.RemoveBodyFromWorldByID(this._attachedBody);
  }
}
